-- --------------------------------------------------------------
-- 
-- New fields for table TSI_SA. These fields are used
-- to compute the adjusted income for the (parent's) candidate
--
-- --------------------------------------------------------------
ALTER TABLE TSI_SA ADD COLUMN zip_code_1        varchar(255)         DEFAULT NULL AFTER household_ses_1;
ALTER TABLE TSI_SA ADD COLUMN zip_code_1_status enum('not_answered') DEFAULT NULL AFTER zip_code_1;
ALTER TABLE TSI_SA ADD COLUMN days_at_house_1   enum('0', '0.5', '1', '1.5', '2', '2.5', '3', '3.5', '4', '4.5', '5', '5.5', '6', '6.5', '7', 'not_answered') DEFAULT NULL AFTER zip_code_1_status;
ALTER TABLE TSI_SA ADD COLUMN zip_code_2        varchar(255)         DEFAULT NULL AFTER household_ses_2;
ALTER TABLE TSI_SA ADD COLUMN zip_code_2_status enum('not_answered') DEFAULT NULL AFTER zip_code_2;
ALTER TABLE TSI_SA ADD COLUMN days_at_house_2   enum('0', '0.5', '1', '1.5', '2', '2.5', '3', '3.5', '4', '4.5', '5', '5.5', '6', '6.5', '7', 'not_answered') DEFAULT NULL AFTER zip_code_2_status;
ALTER TABLE TSI_SA ADD COLUMN adjusted_income   FLOAT(5,2)           DEFAULT NULL AFTER days_at_house_2;

-- -----------------------------------------------------------------------
-- 
-- Median income for all US zip codes 
-- 
-- source: https://factfinder.census.gov/faces/nav/jsf/pages/index.xhtml
--
-- -----------------------------------------------------------------------
DROP TABLE IF EXISTS `median_income`;
CREATE TABLE `median_income` (
    `ZipCode`      int(10) unsigned NOT NULL,
    `MedianIncome` int(10) unsigned DEFAULT NULL,
    PRIMARY KEY (`ZipCode`)
)  ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Median income for each US zip code (used by instrument TSI SA)';




